import { Fragment } from "react";
import classes from'./NavBar.module.css'

const NavBar = () => {
  return (
    <div className={classes.header}>
      <div>TO-DO APP</div>
      <div>
        <button>ADD NEW TO-DO</button>
      </div>
    </div>
  );
};

export default NavBar;
